window.bookSummaryJSON = "<p>The game’s afoot once more as the long-suffering Dr. John Watson and a partially decomposed Warlock Holmes (though he’s getting better) face off against Moriarty’s gang, the Pinkertons, flesh-eating horses, a parliament of imps, boredom, Surrey, a succubus, an overly Canadian aristocrat, a tricycle-fight to the death and the dreaded Pumpcrow. Oh, and a hell-hound, one assumes.</p> <p>Performed by Scott McCormick, Eric Messner, Zeke Alton, Chris Genebach, Michael John Casey, Patrick Bussink, Richard Rohan, Jillian Levine-Sisson, Nora Achrati, Rose Elizabeth Supan, Mort Shelby, Jeff Allin, Bradley Smith, Kimberly Gilbert, Andy Brownstein, Steve Wannall, Yasmin Tuazon, David Jourdan, Gwen Grastorf, Jonathon Church, Nanette Savard, Terence Aselford, Ken Jackson, Lolita Horne, Nick DePinto, Bob Payne, Colleen Delany.</p>"; 
